local domain = "https://krnl.place"
function get(dir) return game:HttpGet(string.format("%s/%s", domain, dir))
end
function key(color) rconsoleprint("[") rconsoleprint("@@"..color.."@@") rconsoleprint("KEY") rconsoleprint("@@LIGHT_GRAY@@") rconsoleprint("]")
end
function getversion() local ver = get("version.txt"):split("") return string.format("v%s.%s.%s%s%s", unpack(ver)):lower()
end
function checkingkey() rconsolename("krnl "..getversion()) key("GREEN") rconsoleprint(" Please enter your key: ") local input = rconsoleinput() key("GREEN") rconsoleprint(" Checking key. (this might take some time..\n") if input == "key" or input == get("getkey.php"):split('value="')[2]:split('" placeholder')[1] then -- very hacky method lol key("GREEN") rconsoleprint(" Correct key!\n") task.wait(0.7) rconsoleclose() else key("RED") rconsoleprint(" Incorrect key!\n") checkingkey() end
end
function inject() rconsoleclear() rconsoleinfo("Checking version.") task.wait(0.7) rconsoleinfo("Scanning.") task.wait(1) key("GREEN") rconsoleprint(" Please get a key here: https://cdn.krnl.place/getkey\n") checkingkey()
end
inject()

